import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav>
        <h1>CryptoImage</h1>
        <p>Fun way to encrypt messages to friends!</p>
      </nav>
      <div>
        <div id="options">
          <div>Encode</div>
          <div>Encode</div>
        </div>
      </div>
    </div>
  );
}

export default App;
